import React from 'react';
import './TopBar.css'

function TopBar({ onButtonClick, textContent }) {
  return (
    <nav className="top-bar">
      Hello!
      <span> </span>
      <button onClick={() => onButtonClick(textContent)}>Click Me</button>
    </nav>
  );
}

export default TopBar;
